import React, { useEffect, useState } from 'react'
import styled from 'styled-components';
import { useNavigate } from 'react-router-dom';
import loader from '../assets/loader.gif'
import { toast, ToastContainer } from 'react-toastify';
import axios from 'axios';
import { getGithubMeRoute, setAvatarRoute } from './../utils/APIRoutes';
import { Buffer } from 'buffer';
import { FiRefreshCcw } from 'react-icons/fi'
import { AiOutlineClose } from 'react-icons/ai'

const SetAvatar = () => {
    const api = "https://api.multiavatar.com/45678945"
    const navigate = useNavigate();
    const [avatars, setAvatars] = useState([
        "",
        "",
        "",
        "",
        "",
        "",
        "",
        "",
    ]);

    const [isLoading, setIsLoading] = useState(false);
    const [selectedAvatar, setSelectedAvatar] = useState(undefined);
    const [currentUser, setcurrentUser] = useState(undefined);
    const toastOptions = { position: "bottom-right", autoClose: 8000, pauseOnHover: true, draggable: true, theme: "dark" }

    useEffect(() => {
        async function getGithubUser() {
            const getUser = await axios.get(getGithubMeRoute, { withCredentials: true })
                .then((res) => res.data);
            if (getUser.status === false) return navigate("/login")
        }
        getGithubUser()
    }, []);

    async function setProfilePicture() {
        if (selectedAvatar === undefined) {
            toast.error("Please select an avatar", toastOptions)
        } else {
            const { data } = await axios.post(`${setAvatarRoute}/${currentUser.user._id}`, {
                image: avatars[selectedAvatar]
            }, { withCredentials: true }).catch(error => {
                toast.error("Error setting avatar.", toastOptions)
            })
            if (data.isSet) {
                currentUser.user.isAvatarImageSet = true;
                currentUser.user.avatarImage = data.image;
                navigate("/");
            } else {
                toast.error("Error setting avatar. Please try again", toastOptions)
            }
        }
    }

    useEffect(() => {
        async function getGithubUser() {
            const user = await axios.get(getGithubMeRoute, { withCredentials: true })
                .then((res) => res.data);
            setcurrentUser(user.user);
            if (!user) {
                navigate("/login");
            }
        }
        getGithubUser();
    }, []);
    async function refresh() {
        setIsLoading(true);
        const data = [];
        for (let i = 0; i < 4; i++) {
            await axios.get(`${api}/${Math.round(Math.random() * 1000)}`)
                .then((image) => {
                    const buffer = new Buffer(image.data);
                    data.push(buffer.toString("base64"));
                })
                .catch((err) => {
                    toast.error(err.response.data, toastOptions)
                });
        }
        if (data.length > 0) {
            setAvatars(data);
        } else {
            setAvatars([
                "",
                "",
                "",
                "",
                "",
                "",
                "",
                ""
            ]);

        }
        setIsLoading(false);
    }

    return (
        <>
            {isLoading ? <Container>
                <img src={loader} alt="loader" className='loader' />
            </Container> : (
                <Container>
                    <div className='close' onClick={() => navigate("/")}>
                        <AiOutlineClose />
                    </div>
                    <div className='title-container'>
                        <h1>Pick an avatar as your profile picture</h1>
                    </div>
                    <div className='avatars'>
                        {
                            avatars.map((avatar, index) => {
                                return (
                                    <div key={index} className={`avatar ${selectedAvatar === index ? "selected" : ""}`}>
                                        <img src={`data:image/svg+xml;base64,${avatar}`} alt="avatar"
                                            onClick={() => setSelectedAvatar(index)} />
                                    </div>
                                )
                            })
                        }
                    </div>
                    <div className='buttons'>
                        <button className='submit-btn' onClick={setProfilePicture}>set as Profile Picture</button>
                        <button className='submit-btn refresh' onClick={refresh}><FiRefreshCcw /></button>
                    </div>
                </Container>
            )}
            <ToastContainer />
        </>
    )
}


const Container = styled.div`
display:flex;
justify-content:center;
align-items:center;
flex-direction:column;
gap:3rem;
background-color:#010409;
height:100vh;
width:100vw;
.loader {
    max-inline-size:100%;
}
.close {
    color:white;
    background-color: #161b22;
    width:50px;
    height: 50px;
    display:flex;
    align-items:center;
    justify-content:center;
    border-radius:50%;
    cursor: pointer;
}
.title-container {
    h1 {
        color:white
    }
}
.avatars {
    width: 100%;
    display:flex;
    flex-wrap:wrap;
    gap:2rem;
    padding:1rem 0rem;
    justify-content:center;
    @media (max-width: 582px) {
        flex-wrap:nowrap;
        overflow-y:auto;
    }
    &::-webkit-scrollbar {
        height:.4rem;
        &-thumb {
            background-color:#ffffff39;
            width: .1rem;
            border-radius:1rem;
        }
    }
    .avatar {
        border: .4rem solid transparent;
        padding: .4rem;
        border-radius:5rem;
        display:flex;
        justify-content:color-interpolation-filters;
        align-items:color-interpolation-filters;
        transition: .5s ease-in-out;
        img {
            height: 6rem;
        }
    }
    .selected {
            border: .4rem solid #b2b100;
        }
}
.buttons {
    display:flex;
    gap:1rem;
    .submit-btn {
    background-color:#b2b100;
    color:white;
    padding:1rem 2rem;
    border:none;
    font-weight:bold;
    cursor: pointer;
    border-radius:.4rem;
    text-transform:uppercase;
    transition: 0.5s ease-in-out;
    &:hover {
        background-color:#727303;
    }
    }
    .refresh {
        background-color:#161b22!important;
    }
}

`;

export default SetAvatar